  ASSIGN uselessWords = "RAPTOR I DO HOW WHO WHAT WHEN WHERE FOR A DONT KNOW AND TO WITH MY IS"
  ASSIGN specResponse = "IDK I HEARD YA CAN FIX MY BROKEN PRINTER"
  ASSIGN AppendResp = " {Response.upper}%20{specResponse.upper}"
  ASSIGN AppArrResp = AppendResp.split(" ")
}

//add itself in case if it goes through the specific issue loop
ASSIGN searchWords = "{searchWords}"
ASSIGN ArrSplit = "%20"
ASSIGN ArrSearchWords = "{searchWords.split(ArrSplit)}"
ASSIGN ArrayUwords = uselessWords.split(" ")
FOREACH word IN AppArrResp
{
	ASSIGN tempArrSWords = "{searchWords.split(ArrSplit)}"
	ASSIGN isUseless = 0
	FOREACH uWord IN ArrayUwords
	{
		IF (word = uWord)
		{
			ASSIGN isUseless = 1
		}
	}
	FOREACH sWord IN ArrSearchWords //so it doesnt repeat words after second 
	{
		IF (word = sWord)
		{
			ASSIGN isUseless = 1
		}
	}
	FOREACH tWord IN tempArrSWords //so it doesnt repeat words after first
	{
		IF (word = tWord)
		{
			ASSIGN isUseless = 1
		}

	}
	IF (isUseless = 0)
	{
		searchWords = "{searchWords}%20{word}"
	}
}

