//I NEED TO SPEAK TO SOMEONE
FUNCTION getMeAgent()
{
	ASSIGN agentRequested = 0
  IF (ResponseCap.contains("LIVE PERSON")|ResponseCap.contains("OPERATOR")|ResponseCap.contains("REPRESENTATIVE")|ResponseCap.contains("AGENT")|ResponseCap.contains("HELP ME")|ResponseCap.contains("HUMAN")|ResponseCap.contains("SUPPORT"))
  {
    agentRequested = 1
  }
  IF (ResponseCap.contains("DISCONNECTED")|ResponseCap.contains("CHAT END")|ResponseCap.contains("LOST CONNECTION")|ResponseCap.contains("REAL PERSON"))
  {
	agentRequested = 1
  }
  IF ((agentRequested = 1)&(isClosed=0))
  {
    setResponse("OPERATOR")
    ASSIGN noGen=1
    genAssigned()
    genCat=false
  }
  IF ((agentRequested = 1)& (isClosed=1))
  {
  	setResponse("TICKET")
    ASSIGN noGen=1
    genAssigned()
    genCat=false
  }
}
