FUNCTION checkForError()
{
  IF (ResponseCap.contains("ERROR")|ResponseCap.contains("ISSUE"))
  {
  	setResponse("OPERATOR")
  }
}
//need install for R6
FUNCTION InstallR6()
{
  ASSIGN containsInstall = 0 //for install function
  IF (specReturn = 1)
  {
    setSpec()
  }
  IF (ResponseCap.contains("INSTALL")|ResponseCap.contains("DOWNLOAD"))//|(ResponseCap.contains("SET")&ResponseCap.contains("UP")))
  {
    setResponse("INSTALL")
    ASSIGN noGen=1
    genAssigned()
    genCat=false
	ASSIGN containsInstall = 1
  }
  IF (noInstall = 1)
  {
  	setResponse("COMMUNITY")
  }
  IF (containsInstall = 1)
  {
  	checkForError()
  }
}
FUNCTION isCase()
{
   ASSIGN isCaseArray = ResponseCap.split(" ")
   IF(isCaseArray[1].isnumeric = 1)
   {
    setResponse("CASE")
	ASSIGN CASE = isCaseArray[1]
	ASSIGN noGen=1
    genAssigned()
    genCat=false
   }
}

FUNCTION reconnectMe()
{
  IF (ResponseCap.contains("RECONNECTME"))
  {
  	setResponse("RECONNECT")
	ASSIGN noGen=1
    genAssigned()
    genCat=false
  }
}

//Sub Category for SCANNER
FUNCTION subCategoryScanner()
{
  setSpec()
  IF (ResponseCap.contains("PHOTO")|ResponseCap.contains("PIC")|ResponseCap.contains("CALIBRATE"))
  {
    speCat("PHOTO")
  }
  IF (ResponseCap.contains("UNAVAILABLE")|ResponseCap.contains("NOT AVAILABLE")|ResponseCap.contains("RECOG")|ResponseCap.contains("NOT WORKING")|ResponseCap.contains("HARDWARE")|ResponseCap.contains("SERVICE"))
  {
    speCat("UNAVAILABLE")
  }
  IF (ResponseCap.contains("FLASH")|ResponseCap.contains("BLINK"))
  {
    speCat("BLINKING")
  }
}
//Sub Category for PRINTER
FUNCTION subCategoryPrinter()
{
  setSpec()
  IF (ResponseCap.contains("DELAY")|ResponseCap.contains("SLOW")|ResponseCap.contains("LONG"))
  {
    speCat("DELAY")
  }
  IF (ResponseCap.contains("PHOTO")|ResponseCap.contains("PIC"))
  {
    speCat("PHOTO")
  }
  IF (ResponseCap.contains("DARK")|ResponseCap.contains("LIGHT"))
  {
    speCat("LIGHTING")
  }
  IF (ResponseCap.contains("NOT PRINT")|ResponseCap.contains("STUCK")|ResponseCap.contains("JAM")|ResponseCap.contains("FEED")|ResponseCap.contains("NOTHING"))
  {
    speCat("JAM")
  }
  IF (ResponseCap.contains("DUST")|ResponseCap.contains("DOT")|ResponseCap.contains("LINE"))
  {
    speCat("DIRTY")
  }
  //IF (ResponseCap.contains("FLASH")|ResponseCap.contains("BLINK"))
  IF (ResponseCap.contains("SIDE")|ResponseCap.contains("DUO")|ResponseCap.contains("DUAL"))
  {
    speCat("PRINTSIDE")
  }
}
