//Formal Request
FUNCTION isFormalRequest()
{
  ASSIGN isFormal=0
  IF (ResponseCap.contains("REMOVE")&ResponseCap.contains("USER"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("BUILDING")&ResponseCap.contains("MODIFY"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("DELETE")&ResponseCap.contains("USER"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("DISABLE")&ResponseCap.contains("CHECK"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("BUILD")&ResponseCap.contains("CHANGE"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("CHANGE")&ResponseCap.contains("ADDRESS"))
  {
    ASSIGN isFormal=1
  }
    IF (ResponseCap.contains("CHANGE")&ResponseCap.contains("BUILDING"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("PURGE")&ResponseCap.contains("USER"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("DELETE")&ResponseCap.contains("CONTACT"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("DEACTIVATE")&ResponseCap.contains("CONTACT"))
  {
    ASSIGN isFormal=1
  }
  IF (ResponseCap.contains("ADD")&ResponseCap.contains("BUILD"))
  {
    ASSIGN isFormal=1
  }
  IF (isFormal = 1)
  {
    setResponse("FORMAL")
    ASSIGN noGen=1
  }
}
//Single Keyword
FUNCTION genCategory()
{
  ASSIGN unknownAnswer=0
  //IF (ArrayResp.size() < 3)
 // {
  //  greetings()
 // }
  //If phrase is too long, ROSCA will skip asking for the specifics
  IF (ArrayResp.size() > 15)
  {
    ASSIGN specific=true
  }
  //PRINTER
  IF (ResponseCap.contains("PRINT")|ResponseCap.contains("DYMO")|ResponseCap.contains("TURBO"))
  {
    setResponse("PRINTER")
    genAssigned()
    subCategoryPrinter()
  }
  //SCANNER
  IF ResponseCap.contains("SCAN")
  {
    setResponse("SCANNER")
    genAssigned()
    subCategoryScanner()
  }
  //REPORT
  IF ResponseCap.contains("REPORT")
  {
    setResponse("REPORT")
    genAssigned()
    subCategoryReport()
  }
  //EMERGENCY MANAGEMENT 
  IF ResponseCap.contains("EMERGENCY")
  {
    setResponse("EMERGENCY MANAGEMENT")
    genAssigned()
    subCategoryEM()
  }
  //VOLUNTEER
  IF ResponseCap.contains("VOLUNTEER")
  {
    setResponse("VOLUNTEER")
    genAssigned()
    subCategoryVolunteer()
  }
  //IMPORT
  IF ResponseCap.contains("IMPORT")
  {
    setResponse("IMPORT")
    genAssigned()
    subCategoryImport()
  }
  IF ResponseCap.contains("STUDENT")
  {
    setResponse("STUDENT")
    genAssigned()
    subCategoryStudent()
  }
  IF ResponseCap.contains("COVID")
  {
    setResponse("COVID")
    genAssigned()
    subCategoryCOVID()
  }
  IF (ResponseCap.contains("CONTACT")&ResponseCap.contains("TRACING"))
  {
    setResponse("COVID")
    genAssigned()
    subCategoryCOVID()
  }
  IF ResponseCap.contains("KIOSK")
  {
    setResponse("KIOSK")
    genAssigned()
    subCategoryKiosk()
  }
  IF (unknownAnswer = 0)
  {
    setResponse("COMMUNITY")
  }
}
//Double Keywords
//It's originally hws, but it pretty much evolved
FUNCTION hardwareservice()
{
  IF (ResponseCap.contains("PRINT")&ResponseCap.contains("SCAN"))
  {
    setResponse("HWS")
    ASSIGN noGen=1
  }
  IF (ResponseCap.contains("SCAN")&ResponseCap.contains("RECOG"))
  {
    setResponse("HWS")
    ASSIGN noGen=1
  }
  IF (ResponseCap.contains("HARDWARE")&ResponseCap.contains("SERVICE"))
  {
    setResponse("HWS")
    ASSIGN noGen=1
  }
  IF (ResponseCap.contains("BILLING")|ResponseCap.contains("COST")|ResponseCap.contains("RENEW")|ResponseCap.contains("ORDER")|ResponseCap.contains("ACCOUNTING")|ResponseCap.contains("INVOICE"))
  {
    setResponse("ACCOUNTING")
    ASSIGN noGen=1
  }
  IF (ResponseCap.contains("CALL")|(ResponseCap.contains("PHONE")&ResponseCap.contains("NUMBER")))
  {
    setResponse("CALLME")
    ASSIGN noGen=1
  }
  //Checks if it is a formal request
  isFormalRequest()
  IF (noGen = 0)
  {
    genCategory()
  }
}
//MAIN general answer that just takes you to community, otherwise checks for other issue
FUNCTION main()
{
  IF (ResponseCap.contains("COMMUNITY"))
  {
    setResponse("COMMUNITY")
  }
  hardwareservice()
}
